import React from "react";
import "./SignInForm.css";
import "react-bootstrap";
import { Button, Form, FormGroup } from "react-bootstrap";
import chatIcon from "../img/chat-app-icon.png";

const SignInForm = () => {
  return (

      <div className="wrapper">

              <div><img src={chatIcon} className="chatIcon" alt="chat-icon"></img></div>
              <div className="text-center mt4 name">Sign in to Chat</div>
             <form>
               <div className="form-field d-flex align-items-center"> <span className="far fa-user"></span> <input type="text" name="userName" id="userName" placeholder="Username"></input></div>

                {/* <input type="password" placeholder="Password"/> */}
                </form>
           </div>
  );
};

export default SignInForm;
